import React from "react";
import { Link } from "react-router-dom";
import "../styles/Header.css";
import { useAuth } from "./context/AuthContext.jsx"; // Importa o contexto de autenticação

const Header = () => {
  const { isAuthenticated, login, logout } = useAuth(); // Obtém o estado de autenticação

  return (
    <header className="header">
      <h1 className="logo">FisioHome</h1>
      <nav className="nav">
        <Link to="/">Home</Link>
        <Link to="/find-a-therapist">Find a Therapist</Link>
        <Link to="/my-concerns">My Concerns</Link>
        <Link to="/about-us">About Us</Link>
        <Link to="/contact-us">Contact Us</Link>
      </nav>
      {isAuthenticated ? (
        <button onClick={logout} className="login-button">
          Logout
        </button>
      ) : (
        <Link to="/login" className="login-button" onClick={login}>
          Login
        </Link>
      )}
    </header>
  );
};

export default Header;
